-- F848 DML
-- the app-id and api-key were generated using the following:
-- select encode(digest(concat('PLTW-APP-ID', current_timestamp::text, random()::text), 'sha256'), 'hex');
-- select encode(digest(concat('PLTW-API-KEY', current_timestamp::text, random()::text), 'sha256'), 'hex');

DO
$BODY$
BEGIN
    IF NOT EXISTS (
        SELECT 1
        FROM appconfiguration conf
        JOIN assessmentprogram ap ON conf.assessmentprogramid = ap.id AND ap.activeflag IS TRUE
        WHERE conf.activeflag IS TRUE
        AND conf.attrtype = 'app-id'
        AND ap.abbreviatedname = 'PLTW'
    ) THEN
    	RAISE NOTICE 'Did not find app-id for PLTW, inserting...';
        VALUES (
            (SELECT id FROM assessmentprogram WHERE abbreviatedname = 'PLTW'),
            'app-id',
            'app-id',
            'App ID',
            '88eeb634cf6f7b10fe16d76bbec1b08985f5d5a5e2da0a58d9a4560484b44eb7'
        );
    ELSE
        RAISE NOTICE 'Found app-id for PLTW, skipping insert';
    END IF;
    
    IF NOT EXISTS (
        SELECT 1
        FROM appconfiguration conf
        JOIN assessmentprogram ap ON conf.assessmentprogramid = ap.id AND ap.activeflag IS TRUE
        WHERE conf.activeflag IS TRUE
        AND conf.attrtype = 'api-key'
        AND ap.abbreviatedname = 'PLTW'
    ) THEN
    	RAISE NOTICE 'Did not find api-key for PLTW, inserting...';
        VALUES (
            (SELECT id FROM assessmentprogram WHERE abbreviatedname = 'PLTW'),
            'api-key',
            'api-key',
            'API Key',
            '8177862264f4a944dcced740dce8b9be7a3390ff45db5766ec23ab0e1b48608f'
        );
    ELSE
    	RAISE NOTICE 'Found api-key for PLTW, skipping insert';
    END IF;
    
    IF NOT EXISTS (
    	SELECT 1
    	FROM appconfiguration conf
    	JOIN assessmentprogram ap ON conf.assessmentprogramid = ap.id AND ap.activeflag IS TRUE
        WHERE conf.activeflag IS TRUE
        AND conf.attrtype = 'api-user'
        AND ap.abbreviatedname = 'PLTW'
    ) THEN
    	RAISE NOTICE 'Did not find api-user for PLTW, inserting...';
    	
	    VALUES (
		    'PLTW API',
		    'USER',
		    'pltw-api-user',
		    'THIS-IS-THE-PLTW-PASSWORD',
		    'ats_kite_messages@ku.edu',
		    (SELECT id FROM aartuser WHERE username = 'cetesysadmin' LIMIT 1),
		    (SELECT id FROM aartuser WHERE username = 'cetesysadmin' LIMIT 1)
    	);
        
        VALUES (
            (SELECT id FROM assessmentprogram WHERE abbreviatedname = 'PLTW'),
            'api-user',
            'api-user',
            'API User ID for assessment program',
            (SELECT id FROM aartuser WHERE username = 'pltw-api-user')::TEXT
        );
    ELSE
        RAISE NOTICE 'Found api-user for PLTW, skipping insert';
    END IF;
    
    IF NOT EXISTS (
    	SELECT 1
    	FROM appconfiguration conf
    	JOIN assessmentprogram ap ON conf.assessmentprogramid = ap.id AND ap.activeflag IS TRUE
        WHERE conf.activeflag IS TRUE
        AND conf.attrtype = 'api-check-hashes'
        AND ap.abbreviatedname = 'PLTW'
    ) THEN
    	RAISE NOTICE 'Did not find api-check-hashes for PLTW, inserting...';
    	
        VALUES (
            (SELECT id FROM assessmentprogram WHERE abbreviatedname = 'PLTW'),
            'api-check-hashes',
            'api-check-hashes',
            'Specifies whether header and body hashes should be compared',
            'true'
        );
    ELSE
        RAISE NOTICE 'Found api-check-hashes for PLTW, skipping insert';
    END IF;
    
    
    
END;
$BODY$;
